    //------------------------------------------------------------------------------REGISTROS AUTENTICADOS

    private function autenticarResultado($r, $placa, $tipo_prueba, $fechaPrueba) {
        //        echo $fechaPrueba . "<br>";
        //        echo $this->fechaJuez . "<br><br>";
        if ($r->autentico !== "1" && $this->fechaJuez <= $fechaPrueba) {
            array_push($this->resultadosAlterados, (object) array(
                        "placa" => $placa,
                        "tipo_prueba" => $tipo_prueba,
                        "old" => $r->old,
                        "new" => $r->new,
            ));
        }
    }

    private function autenticarPrueba($placa, $idprueba) {
        $aPrueba = $this->Mprueba->getxId($idprueba);
        if ($aPrueba->num_rows() > 0) {
            $p = $aPrueba->result();
            if ($p[0]->autentico !== "1" && $this->fechaJuez <= $p[0]->fechainicial) {
                array_push($this->pruebasAlteradas, (object) array(
                            "placa" => $placa,
                            "tipo_prueba" => "p",
                            "old" => $p[0]->old,
                            "new" => $p[0]->new,
                ));
            }
        }
    }

    //------------------------------------------------------------------------------CORREGIR FUR
    private function corregirFur($asterisco, $idprueba, $estado) {
        if ($asterisco && $estado == '2') {
            $this->Mprueba->actualizarEstado($idprueba, '1');
            $estado = '1';
            $this->furCorregido = "1";
        }
        if (!$asterisco && $estado == '1') {
            $this->Mprueba->actualizarEstado($idprueba, '2');
            $estado = '2';
            $this->furCorregido = "1";
        }
        return $estado;
    }

    //------------------------------------------------------------------------------LUCES
    public $ifdefLuzMinBaja;
    public $ifdefInclinacionLuces;
    public $ifdefIntensidadTotal;
    public $asteriscoLuces = false;

    public function getLuces($idhojapruebas, $vehiculo) {
        $this->ifLuzMinBaja = false;
        $this->ifdefInclinacionLuces = false;
        $this->ifdefIntensidadTotal = false;
        $data['idhojapruebas'] = $idhojapruebas;
        $data['idtipo_prueba'] = "1";
        $data['order'] = $this->order;
        $result = $this->Mprueba->get($data);
        $configLuces = "";
        $simultaneaBaja = '';
        $simultaneaAlta = '';
        $simultaneaAntiniebla = '';
        $max_luz_total = '';
        $intensidad_total = '';
        //        $aprobadoLuces = true;
        if ($result->num_rows() > 0) {
            $r = $result->result();
            $data['idprueba'] = $r[0]->idprueba;
            $operario = $this->getUsuario($r[0]->idusuario);

            //            $lucesParam = new luces_param();
            $rango_min_inc = $this->getRango_min_inc();
            $rango_max_inc = $this->getRango_max_inc();
            $min_luz_baja = $this->getMin_luz_baja();
            $max_luz_total = $this->getMax_luz_total();
            $simultanea = $this->getResultado($data, 'independiente', '', $vehiculo->numero_placa, $data['idtipo_prueba']);
            $configLuces = $this->getResultado($data, 'optSimul', '', $vehiculo->numero_placa, $data['idtipo_prueba']);
            $conmuLux = $this->getResultado($data, 'conmuLux', '', $vehiculo->numero_placa, $data['idtipo_prueba']);
            //            $valor_antiniebla_izquierda_1 = $this->getResultadoIDCF($data, 191);
            $intensidad_total = $this->evalLuzMaxTotal($this->getResultado($data, 'intensidad_total', '', $vehiculo->numero_placa, $data['idtipo_prueba']), $max_luz_total);
            if ($vehiculo->idclase === 10) {
                $intensidad_total = "";
            }
            if ($vehiculo->tipo_vehiculo !== '3') {
                $alta_izquierda = $this->rdnr($this->getResultado($data, '1', 'alta_izquierda', $vehiculo->numero_placa, $data['idtipo_prueba']));
                $alta_derecha = $this->rdnr($this->getResultado($data, '1', 'alta_derecha', $vehiculo->numero_placa, $data['idtipo_prueba']));
                $valor_antiniebla_derecha_1 = $this->rdnr($this->getResultado($data, '1', 'antis_derecha', $vehiculo->numero_placa, $data['idtipo_prueba']));
                $valor_antiniebla_izquierda_1 = $this->rdnr($this->getResultado($data, '1', 'antis_izquierda', $vehiculo->numero_placa, $data['idtipo_prueba']));
            } else {
                //                $alta_izquierda = $this->evalLuzMinBaja($this->rdnr($this->getResultado($data, '1', 'alta_izquierda')), $min_luz_baja);
                $alta_izquierda = $this->rdnr($this->getResultado($data, '1', 'alta_izquierda', $vehiculo->numero_placa, $data['idtipo_prueba']));
                $alta_derecha = $this->rdnr($this->getResultado($data, '1', 'alta_derecha', $vehiculo->numero_placa, $data['idtipo_prueba']));
                //                $alta_derecha = $this->evalLuzMinBaja($this->rdnr($this->getResultado($data, '1', 'alta_derecha')), $min_luz_baja);
                $valorAD = $this->getResultado($data, '1', 'antis_derecha', $vehiculo->numero_placa, $data['idtipo_prueba']);
                $valorAI = $this->getResultado($data, '1', 'antis_izquierda', $vehiculo->numero_placa, $data['idtipo_prueba']);
                if ($valorAD !== '') {
                    $valor_antiniebla_derecha_1 = $this->evalLuzMinBaja($this->rdnr($valorAD), $min_luz_baja);
                } else {
                    $valor_antiniebla_derecha_1 = '';
                }
                if ($valorAI !== '') {
                    $valor_antiniebla_izquierda_1 = $this->evalLuzMinBaja($this->rdnr($valorAI), $min_luz_baja);
                } else {
                    $valor_antiniebla_izquierda_1 = '';
                }
                if ($this->evalLucFullMotos == "0") {
                    $alta_izquierda = '';
                    $alta_derecha = '';
                    $valor_antiniebla_izquierda_1 = '';
                    $valor_antiniebla_derecha_1 = '';
                }
            }
            if ($simultanea == '0') {
                if ($conmuLux !== "") {
                    if (substr($conmuLux, 0, 1) == "1") {
                        $simultaneaBaja = 'SI';
                    } else {
                        $simultaneaBaja = 'NO';
                    }
                    if (substr($conmuLux, 1, 1) == "1") {
                        $simultaneaAlta = 'SI';
                    } else {
                        $simultaneaAlta = 'NO';
                    }
                    if (substr($conmuLux, 2, 1) == "1") {
                        $simultaneaAntiniebla = 'SI';
                    } else {
                        $simultaneaAntiniebla = 'NO';
                    }
                }

                if ($configLuces == "1" && $this->obseConfLuces == '1') {
                    $configLuces = "<strong>Configuración de encendido de las luces:</strong><br>->ALTAS Y ANTINIEBLAS SON SIMULTANEAS<br>->BAJAS Y ANTINIEBLAS SON SIMULTANEAS<br>->BAJAS Y ALTAS NO SON SIMULTANEAS";
                } else if ($configLuces == "2" && $this->obseConfLuces == '1') {
                    $configLuces = "<strong>Configuración de encendido de las luces:</strong><br>->ALTAS Y BAJAS SON SIMULTANEAS<br>->BAJAS Y ANTINIEBLAS SON SIMULTANEAS<br>->ALTAS Y ANTINIEBLAS NO SON SIMULTANEAS";
                } else if ($configLuces == "3" && $this->obseConfLuces == '1') {
                    $configLuces = "<strong>Configuración de encendido de las luces:</strong><br>->ALTAS Y ANTINIEBLAS SON SIMULTANEAS<br>->BAJAS Y ALTAS SON SIMULTANEAS<br>->BAJAS Y ANTINIEBLAS NO SON SIMULTANEAS";
                } else {
                    $configLuces = "";
                    //                    $simultaneaAlta = 'NO';
                    //                    $simultaneaBaja = 'NO';
                    //                    $simultaneaAntiniebla = 'SI';
                }
            } else {
                $configLuces = "";
                $simultaneaAlta = 'SI';
                $simultaneaBaja = 'SI';
                $simultaneaAntiniebla = 'SI';
            }
            if ($this->nombreClase->nombre == 'MOTOCICLETA' || $this->nombreClase->nombre == 'MOTOCARRO') {
                $configLuces = "";
                $simultaneaBaja = '';
                $simultaneaAlta = '';
                $simultaneaAntiniebla = '';
                $max_luz_total = '';
                $intensidad_total = '';
                //                $alta_izquierda = '';
