    public function evalOpacidad($dato, $max) {
        if ($dato !== '') {
            if (floatval($max) >= floatval($dato)) {
                return $dato;
            } else {
                $this->setDefAnormalesGas("true", '2.1.1.1.11', "Incumplimiento de niveles máximos permitidos por la autoridad competente.");
                $this->setDefOpa();
                $this->asteriscoOpacidad = true;
                return $dato . "*";
            }
        }
    }

    public function evalOpacidadK($dato, $v) {
        if ($dato !== '') {
            if (floatval($this->getMaxTabla31($v)) >= floatval($dato)) {
                return $dato;
            } else {
                $this->setDefAnormalesGas("true", '2.1.1.1.11', "Incumplimiento de niveles máximos permitidos por la autoridad competente.");
                $this->setDefOpa();
                $this->asteriscoOpacidad = true;
                return $dato . "*";
            }
        }
    }

    public function getMaxTabla31($veh) {
        $flag = 0;
        $aplicarParaTodos = false;
        if ($this->fecha_inicialG >= '2025-01-01') {
            $aplicarParaTodos = true;
        }
        if ($veh->aplicares2703 != '1') {
            $ajuste_31 = 0;
            if ($aplicarParaTodos) {
                $ajuste_31 = 1.5;
            }
            if (intval($veh->cilindraje) < 5000) {
                if (intval($veh->ano_modelo) >= 2016) {
                    $flag = 4.0 - $ajuste_31;
                } else if (intval($veh->ano_modelo) >= 2001 && intval($veh->ano_modelo) <= 2015) {
                    $flag = 5.0 - $ajuste_31;
                } else { // menores al año 2000
                    $flag = 6.0 - $ajuste_31;
                }
            } else {
                if (intval($veh->ano_modelo) >= 2016) {
                    $flag = 3.5 - $ajuste_31;
                } else if (intval($veh->ano_modelo) >= 2001 && intval($veh->ano_modelo) <= 2015) {
                    $flag = 4.5 - $ajuste_31;
                } else { // menores al año 2000
                    $flag = 5.5 - $ajuste_31;
                }
            }
        } else {

            if ($veh->autoregulado == '1' || $aplicarParaTodos) {
                if (intval($veh->cilindraje) < 5000) {
                    if (intval($veh->ano_modelo) >= 2016) {
                        $flag = 2.0;
                    } else if (intval($veh->ano_modelo) >= 2001 && intval($veh->ano_modelo) <= 2015) {
                        $flag = 2.4;
                    } else { // menores al año 2000
                        $flag = 3.4;
                    }
                } else {
                    if (intval($veh->ano_modelo) >= 2016) {
                        $flag = 1.8;
                    } else if (intval($veh->ano_modelo) >= 2001 && intval($veh->ano_modelo) <= 2015) {
                        $flag = 2.0;
                    } else { // menores al año 2000
                        $flag = 3.4;
                    }
                }
            } else {
                if (intval($veh->cilindraje) < 5000) {
                    if (intval($veh->ano_modelo) >= 2016) {
                        $flag = 2.5;
                    } else if (intval($veh->ano_modelo) >= 2001 && intval($veh->ano_modelo) <= 2015) {
                        $flag = 3.5;
                    } else { // menores al año 2000
                        $flag = 4.5;
                    }
                } else {
                    if (intval($veh->ano_modelo) >= 2016) {
                        $flag = 2.0;
                    } else if (intval($veh->ano_modelo) >= 2001 && intval($veh->ano_modelo) <= 2015) {
                        $flag = 3.0;
                    } else { // menores al año 2000
                        $flag = 4.0;
                    }
                }
            }
        }
//        echo $flag . '|';
        return $flag;
    }

