    public $defProfLab = "0";

    //------------------------------------------------------------------------------SENSORIAL
    public function getSensorial($idhojapruebas, $vehiculo) {
        $data['idhojapruebas'] = $idhojapruebas;
        $data['idtipo_prueba'] = "8";
        $data['order'] = $this->order;
        $result = $this->Mprueba->get($data);
        if ($result->num_rows() > 0) {
            $r = $result->result();
            $data['idprueba'] = $r[0]->idprueba;
            $operario = $this->getUsuario($r[0]->idusuario);
            if ($r[0]->estado == '1' || $r[0]->estado == '3') {
                $this->aprobado = false;
            }
            $this->autenticarPrueba($vehiculo->numero_placa, $r[0]->idprueba);
            $visual = (object) array(
                        'operario' => $operario->nombres . " " . $operario->apellidos,
                        'documento' => $operario->identificacion,
                        'idprueba' => $r[0]->idprueba,
                        'operarios_sensorial' => $this->Mprueba->getOperariosSensorial($r[0]->idprueba),
            );
            $rta = $this->getResultadoAll($data, 'defecto', 153);
            if ($rta !== '') {
                foreach ($rta as $r) {
                    $this->autenticarResultado($r, $vehiculo->numero_placa, $data['idtipo_prueba'], $r->fechaguardado);
                    foreach ($this->defectos as $d) {
                        if ($r->valor == $d->codigo) {
                            if ($d->ensenanza == '0') {
                                if ($d->tipo == "A") {
                                    if (
                                            $d->codigo == '1.2.9.18.6' ||
                                            $d->codigo == '1.1.11.37.6' ||
                                            $d->codigo == '1.1.11.37.7'
                                    ) {
                                        $this->defProfLab = "1";
                                    }
                                    array_push($this->defectosSA, (object) array(
                                                "codigo" => $d->codigo,
                                                "descripcion" => $d->descripcion,
                                                "grupo" => $d->nombre_grupo,
                                                "tipo" => 'A',
                                    ));
                                } else {
                                    array_push($this->defectosSB, (object) array(
                                                "codigo" => $d->codigo,
                                                "descripcion" => $d->descripcion,
                                                "grupo" => $d->nombre_grupo,
                                                "tipo" => 'B',
                                    ));
                                }
                            } else {
