    private function getFirmaJefe($documento, $reisnp) {

        $encrptopenssl = new Opensslencryptdecrypt();
        $this->sistemaOperativo = sistemaoperativo();

                if ($this->sistemaOperativo == null || $this->sistemaOperativo == "") {
                    if ($this->firmaDigital == '1') {
                        $file = "tcm/firmafur/" . $reisnp . "/firma.dat";
                    } else {
                        $file = 'tcm/usuarios/' . $documento . '/sig.dat';
                    }
                }else{
                    if ($this->firmaDigital == '1') {
                        $file = "c:/tcm/firmafur/" . $reisnp . "/firma.dat";
                    } else {
                        $file = 'C:/tcm/usuarios/' . $documento . '/sig.dat';
                    }
                }
                
                if($documento !== "" && $documento !== null){
                        if (file_exists($file)) {
                            $firma = $encrptopenssl->decrypt(file_get_contents($file, true));
                        } else {
                            $firma = '';
                        }
                        $firma = explode(",", $firma);
                        if (count($firma) > 1) {
                            $firma = $firma[1];
                        } else {
                            $firma = '';
                        }
                    
                    
                }else{
                    $firma = '';
                }
        


        return $firma;
    }

    function carpetaVacia($directorio) {
        $elementos = scandir($directorio);
        // Eliminamos los elementos '.' y '..' que siempre están presentes
        $elementos = array_diff($elementos, array('.', '..'));
        return count($elementos) === 0;
    }

