                }
                $estado = 'error';
            }
            $mensaje = $this->mensajesCI2($rtaCP->CodigoRespuesta, $rtaCP->CodigoRespuesta . '|' . $ocasion . '|' . $estado . '|' . $rtaCP->MensajeRespuesta);
