    private function formato_texto($cadena) {
        $no_permitidas = array("Ñ", "ñ", "á", "é", "í", "ó", "ú", "Á", "É", "Í", "Ó", "Ú", "ñ", "À", "Ã", "Ì", "Ò", "Ù", "Ã™", "Ã ", "Ã¨", "Ã¬", "Ã²", "Ã¹", "ç", "Ç", "Ã¢", "ê", "Ã®", "Ã´", "Ã»", "Ã‚", "ÃŠ", "ÃŽ", "Ã”", "Ã›", "ü", "Ã¶", "Ã–", "Ã¯", "Ã¤", "«", "Ò", "Ã", "Ã„", "Ã‹", "'", "");
        $permitidas = array("N", "n", "a", "e", "i", "o", "u", "A", "E", "I", "O", "U", "n", "N", "A", "E", "I", "O", "U", "a", "e", "i", "o", "u", "c", "C", "a", "e", "i", "o", "u", "A", "E", "I", "O", "U", "u", "o", "O", "i", "a", "e", "U", "I", "A", "E", "", "");
        $texto = str_replace($no_permitidas, $permitidas, $cadena);
        return $texto;
    }

    private function rdnr($valor) {
        $dato = '';
        if ($valor !== '') {
            if (floatval($valor) === 0.00 || floatval($valor) === 0.0 || floatval($valor) === 0) {
                $dato = "0.00";
            } else {
                if (intval($valor) < 10) {
                    $valorNegativo = false;
                    $dato = abs(round($valor, 2));
                    if ($valor < 0) {
                        $valorNegativo = true;
                        if (intval($valor) > -10) {
                            if (substr($dato, 2) == "") {
                                $dato = $dato . ".00";
                            } elseif (substr($dato, 3) == "" || substr($dato, 3) == '0') {
                                $dato = $dato . "0";
                            }
                        } elseif (intval($valor) <= -10 && intval($valor) > -100) {
                            $dato = abs(round($valor, 1));
                            if (substr($dato, 2) == "") {
                                $dato = $dato . ".0";
                            }
                        } else {
                            $dato = abs(round($valor));
                        }
                    } else {
                        if (substr($dato, 1) == "") {
                            $dato = $dato . ".00";
                        } elseif (substr($dato, 3) == "" || substr($dato, 3) == '0') {
                            $dato = $dato . "0";
                        }
                    }
                    if ($valorNegativo) {
                        $dato = "-" . $dato;
                    }
                } elseif (intval($valor) >= 10 && intval($valor) < 100) {
                    $dato = round($valor, 1);
                    if (substr($dato, 2) == "") {
                        $dato = $dato . ".0";
                    }
                } else {
                    $dato = round($valor);
                }
            }
        }
        return $dato;
    }

    //--------------------------------------------------------------------------PARAMETROS
    //--------------------------------------------------------------------------Opacidad
    public function max_opacidad($modelo) {
        $flag = 0;
        $mod = intval($modelo);
        if ($mod >= 1998) {
            $flag = 35;
        } else if ($mod < 1998 && $mod >= 1985) {
            $flag = 40;
        } else if ($mod < 1985 && $mod >= 1971) {
            $flag = 45;
        } else if ($mod < 1971) {
            $flag = 50;
        }
        return $flag;
    }

    //--------------------------------------------------------------------------Gases
    public function getCoFlag($modelo, $tipoVeh, $tiempos) {
        $flag = 0;
        $mod = intval($modelo);
        if ($tipoVeh === "3") {
            if ($this->fechares762_Chispa !== "" && $this->fechares762_Chispa <= $this->fecha_inicialG) {
                if ($tiempos == "2" && $modelo >= 2010) {
                    $flag = 3.5;
                } else if ($tiempos == "2" && $modelo <= 2009) {
                    $flag = 3.5;
                } else if ($tiempos == "4") {
                    $flag = 3.5;
                }
            } elseif ($this->fechares762 !== "" && $this->fechares762 <= $this->fecha_inicialG) {
                if ($tiempos == "2" && $modelo >= 2010) {
                    $flag = 3.6;
                } else if ($tiempos == "2" && $modelo <= 2009) {
                    $flag = 4.5;
                } else if ($tiempos == "4") {
                    $flag = 3.6;
                }
            } else {
                $flag = 4.5;
            }
        } else {

            if ($this->fechares762_Chispa !== "" && $this->fechares762_Chispa <= $this->fecha_inicialG) {
                if ($mod <= 1984) {
                    $flag = 4.0;
                } else if ($mod > 1984 && $mod <= 1997) {
                    $flag = 3.0;
                } else if ($mod > 1997 && $mod <= 2009) {
                    $flag = 1.0;
                } else if ($mod > 2009) {
                    $flag = 0.8;
                }
            } else {
                if ($mod <= 1970) {
                    $flag = 5.0;
                } else if ($mod > 1970 && $mod <= 1984) {
                    $flag = 4.0;
                } else if ($mod > 1984 && $mod <= 1997) {
                    $flag = 3.0;
                } else if ($mod > 1997) {
                    $flag = 1.0;
                }
            }
        }
        return $flag;
    }

