    public function getHcFlag($modelo, $tipoVeh, $tiempos) {
        $flag = 0;
        $mod = intval($modelo);
        if ($tipoVeh === "3") {
            if ($this->fechares762_Chispa !== "" && $this->fechares762_Chispa <= $this->fecha_inicialG) {
                if ($tiempos == "2") {
                    if ($mod > 2009) {
                        $flag = 1600;
                    } else {
                        $flag = 8000;
                    }
                } else {
                    $flag = 1300;
                }
            } elseif ($this->fechares762 !== "" && $this->fechares762 <= $this->fecha_inicialG) {
                if ($tiempos == "2") {
                    if ($mod > 2009) {
                        $flag = 1600;
                    } else {
                        $flag = 10000;
                    }
                } else {
                    $flag = 1600;
                }
            } else {
                if ($tiempos == "2") {
                    if ($mod > 2009) {
                        $flag = 2000;
                    } else {
                        $flag = 10000;
                    }
                } else {
                    $flag = 2000;
                }
            }
        } else {
            if ($this->fechares762_Chispa !== "" && $this->fechares762_Chispa <= $this->fecha_inicialG) {
                if ($mod <= 1984) {
                    $flag = 650;
                } else if ($mod > 1984 && $mod <= 1997) {
                    $flag = 400;
                } else if ($mod > 1997 && $mod <= 2009) {
                    $flag = 200;
                } else if ($mod > 2009) {
                    $flag = 160;
                }
            } else {
                if ($mod <= 1970) {
                    $flag = 800;
                } else if ($mod > 1970 && $mod <= 1984) {
                    $flag = 650;
                } else if ($mod > 1984 && $mod <= 1997) {
                    $flag = 400;
                } else if ($mod > 1997) {
                    $flag = 200;
                }
            }
        }
        return $flag;
    }

